import React, { Component } from 'react';

import { render } from 'react-dom';



class App extends Component {

  constructor() {
    var today = new Date();
    time = today.getHours() + ':' + today.getMinutes() + ':' + today.getSeconds();
  }

  render() {

    return (

      <div>

        <p>

          { time }

        </p>

      </div>

    );

  }

}

render(<App />, document.getElementById('root'));
